webpackJsonp([0xa4917c3da4f0],{612:function(A,e){A.exports={data:{markdownRemark:{html:'<h3>Clarify Public Launch Expectations</h3>\n<p>We now set clearer expectations for self-managed programs that decide to publicly launch their program without having met the launch criteria. We supply warning messages showing that the program hasn’t met the recommended criteria and also require them to select the checkbox acknowledging that they haven’t met the criteria but still want to launch publicly.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/dec_2016_public_launch-642457af417406cd12ebcc22d75689d3-d0ff7.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 59.336419753086425%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="dec_2016_public_launch"\n        title=""\n        src="/static/dec_2016_public_launch-642457af417406cd12ebcc22d75689d3-b0c9e.jpg"\n        srcset="/static/dec_2016_public_launch-642457af417406cd12ebcc22d75689d3-f36df.jpg 125w,\n/static/dec_2016_public_launch-642457af417406cd12ebcc22d75689d3-4a0b6.jpg 250w,\n/static/dec_2016_public_launch-642457af417406cd12ebcc22d75689d3-b0c9e.jpg 500w,\n/static/dec_2016_public_launch-642457af417406cd12ebcc22d75689d3-8a2fd.jpg 750w,\n/static/dec_2016_public_launch-642457af417406cd12ebcc22d75689d3-219ba.jpg 1000w,\n/static/dec_2016_public_launch-642457af417406cd12ebcc22d75689d3-d0ff7.jpg 1296w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Bounty Statistics</h3>\n<p>When programs award a bounty, we now automatically show them the median, competitive, and top level bounty across the platform for the severity of the vulnerability they are awarding a bounty for. This helps programs to gauge their reward competitiveness and to be as consistent as possible in awarding bounties.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/dec_2016_bbstats-0fab38637cd0b3c3d59d78e30f0f48c8-39f0d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 43.94993045897079%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="dec_2016_bbstats"\n        title=""\n        src="/static/dec_2016_bbstats-0fab38637cd0b3c3d59d78e30f0f48c8-2f183.png"\n        srcset="/static/dec_2016_bbstats-0fab38637cd0b3c3d59d78e30f0f48c8-67829.png 125w,\n/static/dec_2016_bbstats-0fab38637cd0b3c3d59d78e30f0f48c8-5c59f.png 250w,\n/static/dec_2016_bbstats-0fab38637cd0b3c3d59d78e30f0f48c8-2f183.png 500w,\n/static/dec_2016_bbstats-0fab38637cd0b3c3d59d78e30f0f48c8-39f0d.png 719w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Filter by Severity</h3>\n<p>We now enable programs to filter reports in their inbox by severity.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/dec_2016_filter_severity-789fdfc11e33a2b70e5c8067cb808214-7e26b.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 419px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 98.80668257756562%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="dec_2016_filter_severity"\n        title=""\n        src="/static/dec_2016_filter_severity-789fdfc11e33a2b70e5c8067cb808214-7e26b.jpg"\n        srcset="/static/dec_2016_filter_severity-789fdfc11e33a2b70e5c8067cb808214-05970.jpg 125w,\n/static/dec_2016_filter_severity-789fdfc11e33a2b70e5c8067cb808214-861d3.jpg 250w,\n/static/dec_2016_filter_severity-789fdfc11e33a2b70e5c8067cb808214-7e26b.jpg 419w"\n        sizes="(max-width: 419px) 100vw, 419px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Redact Sensitive Information from Reports</h3>\n<p>Programs can now redact sensitive information from reports in a self-service manner.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-315ca.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 73.80281690140845%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="dec_2016_redact_info"\n        title=""\n        src="/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-2f183.png"\n        srcset="/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-67829.png 125w,\n/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-5c59f.png 250w,\n/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-2f183.png 500w,\n/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-c93e8.png 750w,\n/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-4e628.png 1000w,\n/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-315ca.png 1420w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Program Updates</h3>\n<p>We’ve created a new Program Updates tab on the program security page.  Programs can publish and persist updates to their hackers like a mini blog on this tab.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-315ca.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 73.80281690140845%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="dec_2016_program_updates"\n        title=""\n        src="/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-2f183.png"\n        srcset="/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-67829.png 125w,\n/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-5c59f.png 250w,\n/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-2f183.png 500w,\n/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-c93e8.png 750w,\n/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-4e628.png 1000w,\n/static/dec_2016_redact_info-06940f0d273343c39d12fdb301bf8acf-315ca.png 1420w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Monthly Digest Report</h3>\n<p>We’ve implemented monthly digest report emails so that if a user is a member of an active HackerOne program, they’ll be able to see how their program is performing and gain insight into any changes to their program. They’ll receive this email every first business day of the month.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/dec_2016_monthly_digest-1e9b44610628c7ff8f71403aa9952f02-805df.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 68.77697841726619%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="dec_2016_monthly_digest"\n        title=""\n        src="/static/dec_2016_monthly_digest-1e9b44610628c7ff8f71403aa9952f02-2f183.png"\n        srcset="/static/dec_2016_monthly_digest-1e9b44610628c7ff8f71403aa9952f02-67829.png 125w,\n/static/dec_2016_monthly_digest-1e9b44610628c7ff8f71403aa9952f02-5c59f.png 250w,\n/static/dec_2016_monthly_digest-1e9b44610628c7ff8f71403aa9952f02-2f183.png 500w,\n/static/dec_2016_monthly_digest-1e9b44610628c7ff8f71403aa9952f02-805df.png 695w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{path:"/changelog/2016/december",title:"December 2016"}}},pathContext:{}}}});
